pragma solidity 0.8.15;

import "@openzeppelin/contracts/access/Ownable.sol";

import "hardhat/console.sol";


contract PriceOracle is Ownable {
    bytes32 constant pricesSlot = 0x4194285f6b84a8a7c0503ca9f8c9f9fdc21d0506188e977855213f4aab85298e; // keccak256("PRICES_START_SLOT");

    mapping(address => bool) public priceProviderAuthorization;


    /**
     * @dev Method to update list of authorized dataproviders
     * @param priceProviders - set of addresses for which we allow authorization
     */
    function changePriceProviderAuthorization(address[] calldata priceProviders) public onlyOwner {
        for(uint256 i = 0; i < priceProviders.length; ++i) {
            priceProviderAuthorization[priceProviders[i]] = !priceProviderAuthorization[priceProviders[i]];
        }
    }

    function getPrice(uint256 index) public view returns(uint80 price) {
        uint256 prices;
        assembly {
            let slot := add(pricesSlot, div(index, 3))
            let offset := mul(mod(index, 3), 0x50)
            prices := sload(slot)
            price := shr(offset, prices)
        }
    }

    function setPrice(uint256 index, uint80 price) external {
        require(priceProviderAuthorization[msg.sender], "Unauthorized dataprovider");
        assembly {
            let slot := add(pricesSlot, div(index, 3))
            let offset := mul(mod(index, 3), 0x50)
            let prices := sload(slot)
            let mask := not(shl(offset, sub(shl(0x50, 1), 1)))
            prices := add(and(mask, prices), shl(offset, price))
            sstore(slot, prices)
        }
    } 

    function getPrices(uint length) public view returns(uint80[] memory res) {
        res = new uint80[](length);
        for (uint8 i = 0; i < length; ++i) {
            res[i] = getPrice(i);
        }
    }

    function setPrices(bytes32[] calldata prices) public {
        require(priceProviderAuthorization[msg.sender], "Unauthorized dataprovider");
        assembly {
            for { let i := 0 } lt(i, prices.length) { i := add(i, 1) }
            {
                let price := calldataload(add(prices.offset, mul(i, 0x20)))
                if not(iszero(price)) {
                    sstore(add(pricesSlot, i), price)
                }
            }
        }
    }

    function setPricesWithCallBack(uint256[] calldata indexes, uint80[] calldata prices_, address cfd, bytes calldata data) external {
        require(priceProviderAuthorization[msg.sender], "Unauthorized dataprovider");
        uint length = indexes.length;
        for (uint i = 0; i < length; ++i) {
            uint256 index = indexes[i];
            uint80 price = prices_[i];
            assembly {
                let slot := add(pricesSlot, div(index, 3))
                let offset := mul(mod(index, 3), 0x50)
                let prices := sload(slot)
                let mask := not(shl(offset, sub(shl(0x50, 1), 1)))
                prices := add(and(mask, prices), shl(offset, price))
                sstore(slot, prices)
            }
        }
        assembly {
                let ptr := mload(0x40)
                calldatacopy(ptr, data.offset, data.length)
                if iszero(call(gas(), cfd, callvalue(), ptr, data.length, 0, 0)) {
                    returndatacopy(ptr, 0, returndatasize())
                    revert(ptr, returndatasize())
                }
        } 
    }
}"
